import React, { useState } from "react";

const GrossCollection = () => {
  const [selectedCategory, setSelectedCategory] = useState(null);
  const [showDropdown, setShowDropdown] = useState(false);
  const [selectedMainCategory, setSelectedMainCategory] = useState(null);

  const toggleDropdown = () => setShowDropdown((prev) => !prev);

  const handleCategorySelect = (category) => {
    setSelectedCategory(category);
    setShowDropdown(false);
  };

  const categories = [
    "All Time",
    "Day 1",
    "1st Week",
    "10 Days",
    "2 Weeks",
    "3 Weeks",
    "50 Days",
  ];

  const mainCategories = [
    "Nizam",
    "Ceeded",
    "Nellore",
    "Guntur",
    "Krishna",
    "UA",
    "East",
    "West",
  ];

  const towns = [
    "Adoni Town Top Grossers",
    "Adoni Town 1st Week Top Grossers",
    "Anantapur Town Day 1",
    "Guntakal Town Top Grossers",
    "Guntakal Town 1st Week Top 10 Grossers",
    "Kadiri Town Top Grossers",
    "Kadiri Town 1st Week Top 10 Grossers",
    "Kadapa Town Top 10 Grossers",
    "Nandyal Town Day 1",
    "Nandyal Town Top 10 Grossers",
    "Yemmiganur Town 60L+ Grossers",
  ];

  return (
    <div className="p-6 bg-[#111827] min-h-screen text-white">
      <h1 className="text-3xl font-bold mb-6 text-center text-yellow-300">
        AP TG Town Gross Collections
      </h1>

      {/* Category Dropdown */}
      <div className="flex justify-center mb-6 relative">
        <button
          onClick={toggleDropdown}
          className="bg-yellow-400 text-black font-semibold px-4 py-2 rounded hover:bg-yellow-500 transition"
        >
          {selectedCategory ? selectedCategory : "Select Category"}
        </button>

        {showDropdown && (
          <div className="absolute mt-12 bg-white text-black rounded shadow-md z-10 w-40">
            {categories.map((cat) => (
              <div
                key={cat}
                onClick={() => handleCategorySelect(cat)}
                className="px-4 py-2 hover:bg-yellow-100 cursor-pointer"
              >
                {cat}
              </div>
            ))}
          </div>
        )}
      </div>

      {/* Main Categories */}
      <div className="flex flex-wrap justify-center gap-3 mb-8">
        {mainCategories.map((region) => (
          <button
            key={region}
            onClick={() => setSelectedMainCategory(region)}
            className={`px-4 py-2 rounded text-sm font-medium transition ${
              selectedMainCategory === region
                ? "bg-yellow-500 text-black"
                : "bg-yellow-300 text-black hover:bg-yellow-400"
            }`}
          >
            {region}
          </button>
        ))}
      </div>

      {/* Town Buttons */}
      <div className="flex flex-wrap justify-center gap-3 mb-10">
        {towns.map((label) => (
          <button
            key={label}
            className="bg-yellow-400 text-black font-medium px-4 py-2 rounded hover:bg-yellow-500 transition text-sm"
          >
            {label}
          </button>
        ))}
      </div>

      {/* Gross Collection Table */}
      <div className="max-w-md mx-auto border border-yellow-400 rounded p-4 shadow-lg bg-[#1f2937]">
        <h2 className="text-xl font-bold text-yellow-400 mb-4 text-center">
          Yemmiganur Town 60L+ Grossers
        </h2>
        <table className="w-full table-auto text-sm">
          <thead>
            <tr className="text-yellow-300 border-b border-yellow-500">
              <th className="py-2 text-left">Movie</th>
              <th className="py-2 text-left">Gross</th>
            </tr>
          </thead>
          <tbody>
            <tr className="border-b border-yellow-800">
              <td className="py-2">RRR</td>
              <td className="py-2">93.2L</td>
            </tr>
            <tr className="border-b border-yellow-800">
              <td className="py-2">Devara</td>
              <td className="py-2">64.14L</td>
            </tr>
            <tr>
              <td className="py-2">Pushpa 2</td>
              <td className="py-2">60.6L (21D)</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default GrossCollection;
